import React from "react";
import Common from "./Common";
import world from '../image/world.jpg'


const About = () => {
    return (
        <>
            <Common
                title= 'Welcome to About page'
                img = {Business}
                btn= 'Get Started'
                visit = '/service'
            />
        </>
    )
};

export default About;
